import { NavLink } from 'react-router-dom'

const Nav = () => {
  return(
  <nav>
    <NavLink to="/">Home</NavLink>
    <NavLink>Items</NavLink>
    <NavLink>Create Item</NavLink>
    </nav>
  )
}

export default Nav
